import React from "react";
import { NavLink } from "react-router-dom";
import Common from "./Common";
const About = ()=>{
    return(
        <>
           <Common name ="Welcome to my About page"
           visit = "/service"
           btname = "Contact Now"
            />
        </>
    )
}

export default About;
